/*Table structure for table `bbs` */

DROP TABLE IF EXISTS `bbs`;

CREATE TABLE `bbs` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `mid` int(11) DEFAULT NULL COMMENT '模块编号',
  `uid` int(11) DEFAULT NULL COMMENT '发表人',
  `title` varchar(500) DEFAULT NULL COMMENT '帖子名',
  `content` text COMMENT '内容',
  `pid` int(11) DEFAULT NULL COMMENT '可见性编号',
  `viewNum` int(11) DEFAULT NULL COMMENT '浏览量',
  `replayNum` int(11) DEFAULT NULL COMMENT '回复量',
  `postTime` datetime DEFAULT NULL COMMENT '发表时间',
  `updateTime` datetime DEFAULT NULL COMMENT '更新时间',
  `veify` varchar(1) DEFAULT NULL COMMENT '是否审核 0 正常,1审核打回，2伪删除',
  `veifyadvice` varchar(1000) DEFAULT NULL COMMENT '审核意见',
  `status` int(1) DEFAULT NULL COMMENT '1置顶，2。推荐，3加精，4 普通帖子',
  PRIMARY KEY (`id`),
  KEY `FK_bbs_mass` (`mid`),
  KEY `FK_bbs_visiablely` (`pid`),
  KEY `FK_bbs_user` (`uid`),
  CONSTRAINT `FK_bbs_modul` FOREIGN KEY (`mid`) REFERENCES `modul` (`id`),
  CONSTRAINT `FK_bbs_user` FOREIGN KEY (`uid`) REFERENCES `user` (`id`),
  CONSTRAINT `FK_bbs_visiablely` FOREIGN KEY (`pid`) REFERENCES `visiablely` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=52 DEFAULT CHARSET=utf8;

/*Data for the table `bbs` */

insert  into `bbs`(`id`,`mid`,`uid`,`title`,`content`,`pid`,`viewNum`,`replayNum`,`postTime`,`updateTime`,`veify`,`veifyadvice`,`status`) values (1,127,3,'从昨天华鼎奖上现场的照片看，angelababy继整容之后绝对隆胸了','小编预计郭晶晶在明年 2014届 会夺得冠军 大家顶起啊',1,5,100,'2013-04-22 14:16:21','2013-04-22 14:16:21','0',NULL,2),(2,127,2,'从昨天华鼎奖上现场的照片看，angelababy继整容之后绝对隆胸了','据新京报报道，多位网友称，凤凰古城今上午多家商铺关门，渡船停运，网友称，进出城门每天被问“你买票了吗？”凤凰县委办公室和旅游局称，相关部门自中午12点起正召开紧急会议处理。4月10日早上8时开始，湖南凤凰古城售票窗口正式开始对外售票，游客进入凤凰古城风景区不论是否参观景点一律收148元门票费，每张门票含政府税收60元。“这种门票制度会对客流量造成损失。”有商家就担忧，“一旦大量客源流失，商铺的经营会难以为继。”而据薄湘晨报4月13日报道，在与罢市的商家协商中，副县长高湘文继续安抚老板们：“做生意搞投资，本来都有风险。这几天冷清，事情总有个过程，请大家过段时间再看看，很多人不是在乎这个门票多少的。”\r\n\r\n　　“很多人不是在乎这个门票多少的”，在很多时候、尤其是在游客已经到达目的地的时候，门票再贵可能游客也会忍痛进去看一番，但恐怕也不会去第二次，至少回头客会少很多，要知道，凤凰古城的湘西风情，本来是有很多值得游人选择回头欣赏的地方，过去为什么凤凰古城能吸引众多游客乐此不疲的选择作为旅游目的地，很大程度上并非因为那里的各种人造风景，而是冲着这座小小的县城风情去的，而这座县城就象全国、或者说全世界的古城一样，都是敞开、免费的迎接各地游客，这其实是一种旅游优势，带来的人气的同进，更给当地居民带来了丰厚的旅游收入。正是基于这种百姓获利而政府或旅游公司刻意设计的人造景观并不景气的情况下，当地政府出于与百姓争夺旅游利益的贪婪目的，干脆来了个圈城收费，收城市入门费，可谓开创了世界旅游业首例。照此逻辑，今后北京、西安、拉萨诸多的城市都是比凤凰历史更悠久的古城，是不是也可以来个收“进城费”的规定呢？将一个县城都圈起来收入门费，本身就显得极其的荒唐。\r\n\r\n　　我们暂且不论凤凰县收入城费全不合理，至少这项与民争利的方案已经立竿见影的影响到了当地居民好不容易形成了的靠旅游经济带动起来的商业生存模式，我们也看到了收费之前大家预计到的情况，因为散客不来了，客流减少，大量的私家商铺或其它围绕散客经营的店铺生意受到巨大冲击，很多商家的店铺装修都是贷款而来，面临困境显而易见，即使是管理商铺的县工商局长也对前来咨询的老板说，“你晓得我们是一条船上的。”。\r\n\r\n　　有意思的是这次对进城收费的政策，从头到尾甚至并非旅游公司推动，而完全是作为旅游管理者的当地政府；有评论就说，与过去一些景区自身提价不同，此次凤凰古城门票调价的主要推动者是当地政府，而非景区经营者。究其原因，不外乎是为了获得高额的门票收入，同时把一部分消费能力差的游客挡在门外，减轻古城的接待压力。然而结果是游客不买账，商家不满意。政府即便是赚了一点门票钱，可景区冷了，商家走了，就等于搬起石头砸了自己的脚。\r\n\r\n　　其实说是为了减轻古城接待压力，我看都是胡扯蛋的理由，当地政府巴不得人越多越好，真正的目的就是与民争利。现在出现当地商家和群众罢市抗议，还只是反映出对旅游生意经营者带来的利益损害，更多其它的民生问题还会层出不穷的展现出来。今天就有报道一件让人尴尬的几乎是笑话的新闻：家住湖南凤凰古城景区内的黄田，12日本想带女友回家见父母，却被挡在凤凰古城西门检票口。颇有怨气的黄田很是疑惑：他是本地人，为何不能带女朋友回家？对此，景区检票口的工作人员认为，黄田的女朋友是外地人，不在直系亲属的免票政策之内。虽然后来破例放行，他也只能苦笑“太尴尬了，太没有面子了！”\r\n\r\n　　为什么会这样，其实很多外地人根本不太清楚进城收费的民生背景，凤凰县是一座湘西小县城，过去因为贫穷落后而有幸保留下来了一座具有典型湘西风情的小镇，吊脚楼、小河野渡、民族风情-----，加之沈从文、黄永玉等文人画匠对湘西人文背景的美好描述，从上世纪80年代开始，包括张家界、王村、德夯、凤凰在内的整个湘西旅游经济开始吸引了全中国乃至世界的游客目光，而凤凰真正的核心旅游卖点就在于这座小县城，这座现实的生活着众多县城居民的行政区域，人们来凤凰旅游，很大程度上更容易流连忘返并记忆深刻的也是这座位于美丽沱江之畔的小县城，以及城里那些具有典型湘西风情的景观。事实上过去整个湘西的大多数县城，在没有被城市现代化吞噬前，普遍都具有类似的景观，比如我曾经在湘西三线企业呆过的沅陵县城，其老城被五强溪水库淹没前，是湘西最大也最古老的县城，古镇规模比凤凰县城至少大十倍，其县城溪子口一偶同样是吊脚楼，规模都差不多超过凤凰县城，可惜都被没有远见的城市建设毁灭了。幸好因贫穷而留下了一个凤凰古城还能让世人追寻到古老湘西风情的影子。我想说的是，凤凰古城目前仍然还是一座居民生产生活的行政区域，当地政府却将其圈起来向游客收费、收进城费，这势必影响到与居民生活相关的各种民生问题，收费事小，也许确实很多游客就象副县长忽悠商家所说的“不在乎门票多少”，但对当地民生可能带来的冲击很快将显现，今天那位带女朋友见公婆被拦收费的尴尬事只是开始。\r\n\r\n　　所以我们也看到了，凤凰县政府为了收进城费，挖空心思的颁布了《旅游景区门票管理办法》实施细则称，凤凰县居民户籍在外地的直系亲属(是指配偶、祖父母、外祖母、本人及配偶的父母、养父母、兄弟姐妹、子女、养子女、孙子女及外孙子女)凭身份证进入凤凰古城风景名胜区。但直系亲属身份的确认，要由本县居民向社区、村委会、居委会申请，填报信息采集表并进入身份识别系统备案。此外，居住在凤凰古城风景名胜区内的居民操办红白喜事，前来参加的亲朋好友可免票进入。\r\n\r\n　　这些所谓的规定，政府官员不觉得搞笑吗？还好凤凰真是个很小的县城，你可以罗列出一大堆“配偶、祖父母、外祖母、本人及配偶的父母、养父母、兄弟姐妹、子女、养子女、孙子女及外孙子女以及操办红白喜事，前来参加的亲朋好友”给予免费通行，甚至还可以继续罗列更多需要正常进入的群体免票进入，但这事实上已经严重影响到了居民的正常生活，干扰了居民的民生，而目的只有一个，与老百姓争夺利益，这才是这次收进城费事件被广泛关注的根本原因，如果仅仅只是某旅游景区提价也就罢了。想想看，当在居民来个亲戚都得花功夫办什么通行证才能进入，岂止麻烦，当地居民杨华对记者说，相当担心办理申请会泄露亲友的个人隐私，“如何保证隐私，这点我存疑问”。不光本地居民很“烦”，不少商贩也表示这种做法很不合理。在凤凰古城内经营小吃店的商户黄见芳说，他们进古城也要办证，“每天出去采购买货，还得天天出示证件，真是多余”。\r\n\r\n　　进城收费，显然已经脱离了旅游的范畴，成了扰民的歪主意，过去中国人只是质疑寺庙等宗教场所也成了收门票进入的地方，如今连进城也得收费了，说难听点，就是要钱不要脸，到时候游客不来了，商家走了，凤凰还得变成乌鸦。',1,111,100,'2013-04-22 14:15:33','2013-04-22 14:15:33','0',NULL,1),(3,127,1,'从昨天华鼎奖上现场的照片看，angelababy继整容之后绝对隆胸了','小编预计郭晶晶在明年 2014届 会夺得冠军 大家顶起啊',1,103,100,'2013-04-12 14:16:21','2013-04-12 14:16:21','0',NULL,0),(4,127,3,'从昨天华鼎奖上现场的照片看，angelababy继整容之后绝对隆胸了','小编预计郭晶晶在明年 2014届 会夺得冠军 大家顶起啊',1,110,100,'2013-04-12 14:16:21','2013-04-12 14:16:21','0',NULL,2),(5,127,1,'从昨天华鼎奖上现场的照片看，angelababy继整容之后绝对隆胸了','小编预计郭晶晶在明年 2014届 会夺得冠军 大家顶起啊',1,109,100,'2013-04-12 14:16:22','2013-04-12 14:16:22','0',NULL,0),(6,127,1,'从昨天华鼎奖上现场的照片看，angelababy继整容之后绝对隆胸了','小编预计郭晶晶在明年 2014届 会夺得冠军 大家顶起啊',1,102,100,'2013-04-12 14:16:22','2013-04-12 14:16:22','0',NULL,4),(7,127,1,'从昨天华鼎奖上现场的照片看，angelababy继整容之后绝对隆胸了','小编预计郭晶晶在明年 2014届 会夺得冠军 大家顶起啊',1,100,101,'2013-04-22 14:16:22','2013-04-22 14:16:22','0',NULL,0),(8,127,4,'从昨天华鼎奖上现场的照片看，angelababy继整容之后绝对隆胸了','小编预计郭晶晶在明年 2014届 会夺得冠军 大家顶起啊',1,101,101,'2013-04-22 14:16:22'