，地壳应力调整过程中，周边有的断裂带应力上升，有的下降。一般说来，应力增加的断层发生地震的概率会大一些，应力下降的断层发生地震的概率会小一些。但某个断裂带的应力增加，并不意味着该地区近期一定会有地震发生，除非这个断裂带本来就接近失稳状态，应力增加才可能起到临门一脚的作用。至于某个断裂带到底积聚了多少应力，具体在什么情况下可能发生破裂，则是一个世界性的技术难题。汶川大地震后，除余震区发生大量的余震外，在青海、西藏地区发生了8个5级以上中强地震。我市石棉也发生了4.2级中等地震，我市其余地区尚没有3级以上地震发生。\n　　4、雅安属于全国地震重点监视防御区，龙门山、鲜水河、安宁河三大断裂带交汇于我市西南附近地区，长期以来，中小地震时有发生。我市及邻区历史曾发生6级以上地震4次，但人们活动的主要地区没有6级以上地震发生。这次汶川大地震给我市带来了历史上因地震造成灾害损失最重的一次。“6.18”石棉4.2级地震属于该地区正常的地震活动。目前，掌握的资料及宏观异常看，我市没有发生大地震的可能性。\n　　5、帕森斯等人的论文所做的只是地震危险性分析，而不是地震预报，他们的研究无法给出余震发生的准确时间、地点和震级，但对于我们研究地震是有参考价值的。\n　　谢谢你给我们工作的意见、建议，各级党委、政府及地震部门一直密切关注雅安地震活动动向，采取措施，加强我市防震减灾工作。“5.12”汶川大地震后，更是进一步加强了对地震的监测、观测，强化了震情跟踪，加密了震情趋势会商，及时掌握地震动向、及时分析、及时报告。\n\n提问者评价\n\n    谢谢！你的答案让我安心了好多！',1,4,0,'2013-04-22 15:01:37','2013-04-22 15:01:37','0',NULL,4),(48,1,2,'你就sb了吧','真的是 要不要这样啊 sb',3,0,0,'2013-04-22 15:05:38','2013-04-22 15:05:38','0',NULL,4),(49,1,2,'啊飒飒','大第三方的所发生的是',1,0,0,'2013-04-22 15:09:27','2013-04-22 15:09:27','0',NULL,4),(50,64,2,'测试啊','你是sb 不咯 不是别回复啊',1,3,0,'2013-04-22 15:10:58','2013-04-22 15:10:58','0',NULL,4),(51,64,2,'阿什顿萨菲','艾丝凡速度多少发的',1,0,0,'2013-04-22 15:12:05','2013-04-22 15:12:05','0',NULL,4);

