/*Table structure for table `visiablely` */

DROP TABLE IF EXISTS `visiablely`;

CREATE TABLE `visiablely` (
  `id` int(11) NOT NULL COMMENT '编号',
  `type` varchar(1) DEFAULT NULL COMMENT '可见性类型 1所有人可见 2.所有注册用户可见 3 所有可用团员 4 指定部门 5 指定人',
  `oid` int(11) DEFAULT NULL COMMENT '模块或者帖子编号 暂时没用',
  `sql` varchar(1000) DEFAULT NULL COMMENT '可见人 ',
  `userIds` text COMMENT '用户id列表',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

