insert  into `visiablely`(`id`,`type`,`oid`,`sql`,`userIds`) values (1,'1',NULL,NULL,NULL),(2,'2',NULL,NULL,NULL),(3,'3',NULL,NULL,NULL);

/*Table structure for table `uservo` */

DROP TABLE IF EXISTS `uservo`;

/*!50001 DROP VIEW IF EXISTS `uservo` */;
/*!50001 DROP TABLE IF EXISTS `uservo` */;

/*!50001 CREATE TABLE  `uservo`(
 `id` int(11) NOT NULL  default '0' ,
 `username` varchar(100) NULL ,
 `nickname` varchar(100) NULL ,
 `password` varchar(100) NULL ,
 `grade` varchar(100) NULL ,
 `type` varchar(1) NULL ,
 `status` varchar(1) NULL ,
 `startTime` datetime NULL ,
 `regiestTime` datetime NULL ,
 `reply` decimal(32,0) NULL 
)*/;

/*View structure for view uservo */

/*!50001 DROP TABLE IF EXISTS `uservo` */;
/*!50001 DROP VIEW IF EXISTS `uservo` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `uservo` AS select `u`.`id` AS `id`,`u`.`username` AS `username`,`u`.`nickname` AS `nickname`,`u`.`password` AS `password`,`u`.`grade` AS `grade`,`u`.`type` AS `type`,`u`.`status` AS `status`,`u`.`startTime` AS `startTime`,`u`.`regiestTime` AS `regiestTime`,(select sum(`b`.`replayNum`) AS `rn` from `bbs` `b` where (`b`.`uid` = `u`.`id`)) AS `reply` from `user` `u` */;

